import React from 'react'

function Buttons({btnname}) {
    const btnstyle = (e) =>{
        if(btnname == "Low"){
         return "yellow"
        }
       else if(btnname == "Normal"){
         return "green"
        }
       else if(btnname == "High"){
         return "red"
        }
    }
  return (
    <button className={'yellow'}>{btnname}</button>
  )
}

export default Buttons
